  false,\n\t\"url\": null,\n\t\"notes\": \"This data set was used for the analysis
  of adult male and female northern fur seal winter migration and foraging behavior
  published by Sterling et al. (2014). Telemetry data were obtained from five satellite-linked
  conductivity, temperature, and depth data loggers deployed on adult males, and six
  satellite-linked depth data loggers and four satellite transmitters deployed on
  adult females from St. Paul Island (Bering Sea, Alaska, USA) in October 2009. Movement
  and dive behavior data were associated with environmental covariates for analysis.\",\n\t\"license_title\":
